import React from "react";
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Hello {this.props.user}</h2>
      <h3>Welcome to Zays Chamber</h3>
    </div>
  );
}

React.DOM.render(
  <DemoComponent user= "Harsh Agarwal" />,
  document.getElementbyID("root")
);

export default App;
